    </Dummy>
  );
}

function Dummy(props) {
  return (
    <div className='main'>
    <h1>{ props.text }</h1>
      { props.children }
    <a href="#">Inloggen</a>
    </div>
  );
}
function FormInput(props) {
  return (
    <div>
      <input type={ props.type } placeholder={ props.placeholder }></input>
      <label for> </label> 
    </div>
  );
}
export default App;
